import React from 'react'
import { Route, Routes } from 'react-router-dom';
import { Header, Footer } from './components';
import { Catalog, Home, Complex } from './pages';
import axios from 'axios';

import './App.css';

function App() {

  const [complexes, setСomplexes] = React.useState([]);

  const [error, setError] = React.useState(null);
  const [isLoaded, setIsLoaded] = React.useState(false);
  const [items, setItems] = React.useState([]);

  React.useEffect(() => {
  fetch("http://45.135.164.103:8080/api/bath?page=1")
    .then(res => res.json())
    .then(
      (result) => {
        setIsLoaded(true);
        setItems(result);
      },
      (error) => {
        setIsLoaded(true);
        setError(error);
      }
    )
  }, []);

  return (

    <div className="fullpage App">

      <Header />
      <div className="main-content">
        <Routes>
          <Route path="/" element={<Home />} exact />
          <Route path="/catalog" element={<Catalog items={items.data} />} exact />
          <Route path="/complex/:id" element={<Complex />} />
        </Routes>
      </div>

      <Footer />

    </div>

  );
}

export default App;
